import react from 'react'
import BaseLayout from './BaseLayout'

const ContentLayout = (props) => {
    return (
        <BaseLayout>
            {props.children.map((child, idx) => {
                return (
                    <section key={idx} className='contentSection'>
                        {child.props.children}
                    </section>
                )
            })}
        </BaseLayout>
    )
}

export default ContentLayout;
